INSERT INTO `game_question` VALUES (1,'q1','<p>Do you remember when you first met?</p>',1,1,'TM'),(2,'q2','<p>Has your partner fed you with their hands in the past 30 days?</p>',1,1,'TO'),(3,'q3','<p>Have you ever laughed in the middle of a kiss and then continued kissing?&nbsp;</p>',1,1,'TM'),(4,'q4','<p>Have you ever stared at your partner while they were sleeping?</p>',1,1,'TM'),(5,'q5','<p>Did you tell your partner they look beautiful today?</p>',1,1,'TM'),(6,'q6','<p>Have you checked your partner&rsquo;s phone at least once in their absence?</p>',1,1,'TM'),(7,'q7','<p>Has your partner ever forgotten to wish you on an important day?</p>',1,1,'TO'),(8,'q8','<p>Have you been appreciated by your partner in the last 30 days?</p>',1,2,'TO'),(9,'q9','<p>Does your partner reassure you when you feel insecure?</p>',1,2,'TO'),(10,'q10','<p>Has your partner ever expressed in words how much you mean to them?</p>',1,2,'TO'),(11,'q11','<p>Has your partner ever made fun of your appearance that has affected your confidence?</p>',1,2,'TO'),(12,'q12','<p>Do you think your partner becomes disrespectful during an argument?</p>',1,2,'TO'),(13,'q13','<p>When asked for a favour, have you felt your partner did it as a chore, without enthusiasm?</p>',1,3,'TO'),(14,'q14','<p>Does your partner return your public displays of affection?</p>',1,4,'TO'),(15,'q15','<p>Does your partner make an effort to celebrate milestones and anniversaries meaningfully?</p>',1,5,'TO'),(16,'q16','<p>Have you been gifted by your partner for no reason?</p>',1,5,'TO'),(17,'q17','<p>Does your partner put aside their phone and dedicate some time every day to spend it with you?</p>',1,6,'TO'),(18,'q18','<p>Do you eat together at least one meal a day?</p>',1,6,'TM'),(19,'q19','<p>Do you feel your partner criticizes your hobbies or interests?</p>',1,7,'TO'),(20,'q20','<p>Does your partner avoid resolving conflicts?</p>',1,7,'TO'),(21,'q21','<p>Does your partner tend to dismiss what you are saying without even listening to you?</p>',1,7,'TO');
